import math

def count_strong_indices(test_cases):
    results = []
    for (n, a) in test_cases:
        s = 1
        a1 = [a[0]]
        b = [a[-1]]
        for i in range(1, n - 1):
            a1.append(math.gcd(a1[i - 1], a[i]))
            b.append(math.gcd(b[i - 1], a[n - 1 - i]))
        if a1[-1] > 1:
            s += 1
        if b[-1] > 1:
            s += 1
        b = b[::-1]
        for i in range(1, n - 1):
            if math.gcd(a1[i - 1], b[i]) > 1:
                s += 1
        results.append(s)
    return results

